export interface WishlistItem {
    id: number;
    product_id: number;
}
export interface Wishlist {
    id: number;
    customer_id: number;
    name: string;
    token: string;
    is_public: boolean;
    items: WishlistItem[];
}
export interface WishlistProductUrl {
    url: string;
    is_customized: boolean;
}
export interface WishlistProduct {
    name: string;
    price: number;
    is_condition_shown: boolean;
    condition: string;
    custom_url: WishlistProductUrl;
    id: number;
    sale_price: number;
}
